Information
------------------------------

Building Penguin Paradise
Tells the incredible story of SeaWorld Orlando's daring attempt to build the most ambitious penguin attraction in the world. With incredible behind the scenes footage and cutting-edge Computer Generated Images, it will bring to light the audacious feats of SeaWorld's largest ever expansion: freezing Antarctic conditions in Florida, 45 feet high ice cliffs, closer-than-ever animal encounters and a palatial home for 245 penguins. But they have 18 months to finish it and no room for error: can they pull it off before the grand opening day?

